import { Routes, Route } from "react-router-dom";
import Section from "./components/section"
import Layouts from "./pages/layouts/layout"
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Layouts content={<Section />} />}></Route>
        <Route path="/" element={<Layouts content={<Section />} />}></Route>
      </Routes>

    </>
  );
}

export default App;
